import './watched.css';
import React from 'react'

const Watched = () => {
  return (
    <div className='watched'>
      <div className="container">
        <div className="main-header">
          <h1>my watched</h1>
          <span>4movies</span>
        </div>
      </div>
    </div>
  )
}

export default Watched;
